import React from 'react';
import Spinner from 'react-bootstrap/Spinner';

function Loading() {
  return (
    <div>
      <Spinner
        color="#3498db"
        size={350}
        aria-label="Loading..."
      />
    </div>
  );
}
export default Loading;
